Transmits a frame using the slotted CSMA-CA algorithm as specified in IEEE 802.15.4-2006 standard Sect. 7.5.1.4. This command will fail if the current state of the radio is not RADIO_OFF. The initial CSMA-CA parameters are passed as a parameter and may be modified by the callee. The caller must not access <tt>csma</tt> until the <tt>transmitDone</tt> event has been signalled.
<tt>slot0Time</tt> defines the beginning of the first slot in the CAP. Any transmission must commence on a backoff slot boundary relative to <tt>slot0Time</tt>. The last possible time for transmission is defined by <tt>slot0Time+dtMax</tt>. If the transmission cannot commence at or before <tt>slot0Time+dtMax</tt> then an event <tt>transmitDone()</tt> with error code ERETRY will be signalled and <tt>csma</tt> will reflect the current state of the CSMA-CA algorithm. The caller can then resume the transmission of this frame in the next CAP based on the <tt>remainingBackoff</tt> passed in the <tt>transmitDone()</tt> event, by setting <tt>resume</tt> to TRUE in the <tt>transmit()</tt> call.
Iff the ACK_REQUESTED flag is set in the frame's header a successful transmission will include an acknowledgement from the destination; then, the callee will perform the necessary steps for receiving this acknowledgement following the specification in IEEE 802.15.4-2006 Sect. 7.5.6.4.
@param frame The frame to transmit.
@param csma Initial parameters for the slotted CSMA-CA algorithm.
@param slot0Time Reference time for the backoff slot boundaries
@param dtMax <tt>slot0Time+dtMax</tt> is the last time the frame may be transmitted.
@param resume TRUE means that the initial backoff is defined by the <tt>remainingBackoff</tt> parameter, FALSE means the <tt>remainingBackoff</tt> is to be ignored.
@param remainingBackoff initial backoff (ignored if <tt>resume</tt> is FALSE.
@return SUCCESS if the slotted CSMA-CA was triggered successfully; EINVAL if <tt>frame</tt> or a pointer therein is invalid; FAIL otherwise.

Signalled in response to a call to <tt>transmit()</tt>. This event completes the <tt>transmit</tt> operation. A transmission failed if either the channel was never idle during any of the <tt>macMaxCsmaBackoffs+1</tt> transmission attempts, if no acknowledgement was received although one was requested or if the frame could not be transmitted before the specified deadline (<tt>slot0Time+dtMax</tt>).
@param frame The frame that was to be transmitted.
@param csma Parameters for the slotted CSMA-CA algorithm; this pointer is identical to the one passed to the <tt>transmit</tt> command, the content, however, may have changed.
@param ackPendingFlag TRUE if an acknowledgement was received and the "pending" flag is set in the header of the ACK frame, FALSE otherwise (this is typically only relevant for indirect transmissions)
@param remainingBackoff Only valid if <tt>result = ERETRY</tt>, and then it describes the remaining backoff time (in symbols) to be used for the transmission of the frame in the following CAP.
@result result SUCCESS if the the frame was transmitted (and a matching acknowledgement was received, if requested); FAIL if the CSMA-CA algorithm failed because NB > macMaxCsmaBackoffs; ERETRY if the frame could not be transmitted because transmission would have started later than <tt>slot0Time+dtMax</tt>

